import React, { useState } from 'react';
import styled from 'styled-components';
import { motion } from 'framer-motion';
import { Chart as ChartJS, CategoryScale, LinearScale, BarElement, ArcElement, Title, Tooltip, Legend, PointElement, LineElement } from 'chart.js';
import { Bar, Doughnut, Line, Radar } from 'react-chartjs-2';

ChartJS.register(CategoryScale, LinearScale, BarElement, ArcElement, Title, Tooltip, Legend, PointElement, LineElement);

const SpecialtyContainer = styled.div`
  padding: 40px;
  background: linear-gradient(135deg, #f8fafc 0%, #e2e8f0 100%);
`;

const SectionTitle = styled.h2`
  font-family: 'Merriweather', serif;
  font-size: 2.2rem;
  color: #1e3a8a;
  margin-bottom: 15px;
  text-align: center;
`;

const SectionSubtitle = styled.p`
  font-size: 1.1rem;
  color: #64748b;
  text-align: center;
  margin-bottom: 40px;
  line-height: 1.6;
`;

const SpecialtySelector = styled(motion.div)`
  background: white;
  border-radius: 20px;
  padding: 30px;
  margin-bottom: 30px;
  box-shadow: 0 10px 30px rgba(0,0,0,0.1);
  border: 1px solid #e2e8f0;
`;

const SpecialtyButtons = styled.div`
  display: grid;
  grid-template-columns: repeat(auto-fit, minmax(200px, 1fr));
  gap: 15px;
  margin-top: 20px;
`;

const SpecialtyButton = styled.button`
  background: ${props => props.active ? 'linear-gradient(135deg, #1e3a8a, #3730a3)' : 'white'};
  color: ${props => props.active ? 'white' : '#374151'};
  border: 2px solid ${props => props.active ? '#1e3a8a' : '#e5e7eb'};
  padding: 15px 20px;
  border-radius: 12px;
  font-size: 1rem;
  font-weight: 600;
  cursor: pointer;
  transition: all 0.3s ease;
  display: flex;
  align-items: center;
  justify-content: center;
  gap: 10px;

  &:hover {
    background: ${props => props.active ? 'linear-gradient(135deg, #1e3a8a, #3730a3)' : 'rgba(59, 130, 246, 0.05)'};
    border-color: #3b82f6;
    transform: translateY(-2px);
  }
`;

const SpecialtyIcon = styled.span`
  font-size: 1.2rem;
`;

const AnalysisGrid = styled.div`
  display: grid;
  grid-template-columns: repeat(auto-fit, minmax(500px, 1fr));
  gap: 30px;
  margin-bottom: 30px;
`;

const ChartContainer = styled(motion.div)`
  background: white;
  border-radius: 20px;
  padding: 25px;
  box-shadow: 0 10px 30px rgba(0,0,0,0.1);
  border: 1px solid #e2e8f0;
`;

const ChartTitle = styled.h4`
  font-size: 1.3rem;
  color: #1e3a8a;
  margin-bottom: 20px;
  text-align: center;
  font-family: 'Merriweather', serif;
`;

const SpecialtyCard = styled(motion.div)`
  background: white;
  border-radius: 20px;
  padding: 35px;
  margin-bottom: 30px;
  box-shadow: 0 10px 30px rgba(0,0,0,0.1);
  border-left: 5px solid ${props => {
    switch(props.specialty) {
      case 'np': return '#8b5cf6';
      case 'pa': return '#06b6d4';
      case 'family': return '#10b981';
      case 'internal': return '#f59e0b';
      case 'obgyn': return '#ec4899';
      case 'pediatrics': return '#3b82f6';
      default: return '#6b7280';
    }
  }};
`;

const SpecialtyHeader = styled.div`
  display: flex;
  justify-content: space-between;
  align-items: center;
  margin-bottom: 25px;
`;

const SpecialtyName = styled.h3`
  font-family: 'Merriweather', serif;
  font-size: 1.8rem;
  color: #1e3a8a;
  margin: 0;
`;

const SpecialtyCount = styled.div`
  background: ${props => {
    switch(props.specialty) {
      case 'np': return 'rgba(139, 92, 246, 0.1)';
      case 'pa': return 'rgba(6, 182, 212, 0.1)';
      case 'family': return 'rgba(16, 185, 129, 0.1)';
      case 'internal': return 'rgba(245, 158, 11, 0.1)';
      case 'obgyn': return 'rgba(236, 72, 153, 0.1)';
      case 'pediatrics': return 'rgba(59, 130, 246, 0.1)';
      default: return 'rgba(107, 114, 128, 0.1)';
    }
  }};
  color: ${props => {
    switch(props.specialty) {
      case 'np': return '#7c3aed';
      case 'pa': return '#0891b2';
      case 'family': return '#059669';
      case 'internal': return '#d97706';
      case 'obgyn': return '#be185d';
      case 'pediatrics': return '#2563eb';
      default: return '#4b5563';
    }
  }};
  padding: 8px 16px;
  border-radius: 20px;
  font-weight: 600;
  font-size: 0.9rem;
`;

const KeyInsight = styled.div`
  background: linear-gradient(135deg, #dbeafe, #bfdbfe);
  padding: 20px;
  border-radius: 12px;
  border-left: 4px solid #3b82f6;
  margin: 20px 0;
`;

const InsightTitle = styled.h4`
  font-size: 1.1rem;
  font-weight: 600;
  color: #1e40af;
  margin-bottom: 10px;
`;

const InsightText = styled.p`
  font-size: 0.95rem;
  color: #1e40af;
  margin: 0;
  line-height: 1.6;
`;

const BillingAnalysis = styled.div`
  background: linear-gradient(135deg, #fef3c7, #fde68a);
  padding: 25px;
  border-radius: 15px;
  border-left: 4px solid #f59e0b;
  margin: 25px 0;
`;

const MetricsGrid = styled.div`
  display: grid;
  grid-template-columns: repeat(auto-fit, minmax(180px, 1fr));
  gap: 20px;
  margin: 25px 0;
`;

const MetricCard = styled.div`
  background: rgba(255, 255, 255, 0.7);
  padding: 20px;
  border-radius: 12px;
  text-align: center;
`;

const MetricValue = styled.div`
  font-size: 2rem;
  font-weight: 700;
  color: #1f2937;
  margin-bottom: 8px;
`;

const MetricLabel = styled.div`
  font-size: 0.9rem;
  color: #4b5563;
  font-weight: 500;
`;

const EnhancedSpecialtyAnalysis = () => {
  const [selectedSpecialty, setSelectedSpecialty] = useState('np');

  const specialtyData = {
    np: {
      name: 'Nurse Practitioners',
      count: '43,936 providers',
      icon: 'üë©‚Äç‚öïÔ∏è',
      stable: 52,
      increase: 22,
      decrease: 26,
      insights: [
        'Highest volatility among all provider types with only 52% maintaining stable participation',
        '"Incident to" billing practices significantly impact measured participation patterns',
        'Rural NPs show 1.51x higher odds of major increases vs urban counterparts',
        'Female NPs have 22% lower odds of major increases compared to male NPs'
      ],
      billingImpact: {
        directBilling: 68,
        incidentToBilling: 32,
        estimatedUndercount: 15
      },
      practicePatterns: {
        avgPatients: 45,
        ruralPercentage: 21,
        chcAffiliation: 4,
        fullScopeStates: 26
      }
    },
    pa: {
      name: 'Physician Associates',
      count: '22,974 providers',
      icon: 'üë®‚Äç‚öïÔ∏è',
      stable: 52,
      increase: 24,
      decrease: 24,
      insights: [
        'Equally high volatility as NPs with 48% experiencing major changes',
        'Highest rate of major increases (24%) among all specialties',
        'Supervision requirements create unique billing pattern complexities',
        'Rural practice associated with 20% higher odds of major increases'
      ],
      billingImpact: {
        directBilling: 72,
        incidentToBilling: 28,
        estimatedUndercount: 12
      },
      practicePatterns: {
        avgPatients: 42,
        ruralPercentage: 20,
        chcAffiliation: 3,
        supervisionRequired: 85
      }
    },
    family: {
      name: 'Family Medicine',
      count: '52,390 providers',
      icon: 'üè†',
      stable: 67,
      increase: 14,
      decrease: 20,
      insights: [
        'Most stable physician specialty with 67% maintaining consistent participation',
        'Comprehensive care model supports sustained Medicaid engagement',
        'Rural family physicians face unique challenges with 22% higher decrease odds',
        'Strong correlation between initial patient volume and long-term stability'
      ],
      billingImpact: {
        directBilling: 95,
        incidentToBilling: 5,
        estimatedUndercount: 2
      },
      practicePatterns: {
        avgPatients: 78,
        ruralPercentage: 25,
        chcAffiliation: 5,
        comprehensiveCare: 92
      }
    },
    internal: {
      name: 'Internal Medicine',
      count: '52,755 providers',
      icon: 'üî¨',
      stable: 64,
      increase: 17,
      decrease: 19,
      insights: [
        'Moderate stability with 64% maintaining steady participation patterns',
        'Urban concentration limits rural access challenges seen in other specialties',
        'Complex patient populations require sustained provider relationships',
        'Hospital affiliations provide institutional stability support'
      ],
      billingImpact: {
        directBilling: 93,
        incidentToBilling: 7,
        estimatedUndercount: 3
      },
      practicePatterns: {
        avgPatients: 72,
        ruralPercentage: 10,
        chcAffiliation: 2,
        hospitalAffiliation: 68
      }
    },
    obgyn: {
      name: 'OB/GYN',
      count: '20,289 providers',
      icon: 'ü§±',
      stable: 68,
      increase: 16,
      decrease: 16,
      insights: [
        'Second highest stability rate (68%) due to essential services coverage',
        'Pregnancy and reproductive care create natural patient retention',
        'Lower rural representation limits geographic access challenges',
        'Medicaid expansion significantly improved participation rates'
      ],
      billingImpact: {
        directBilling: 94,
        incidentToBilling: 6,
        estimatedUndercount: 2
      },
      practicePatterns: {
        avgPatients: 65,
        ruralPercentage: 12,
        chcAffiliation: 3,
        maternalCare: 78
      }
    },
    pediatrics: {
      name: 'Pediatrics',
      count: '28,212 providers',
      icon: 'üë∂',
      stable: 70,
      increase: 14,
      decrease: 16,
      insights: [
        'Highest stability (70%) driven by routine well-child care requirements',
        'Consistent care patterns due to childhood vaccination schedules',
        'Strong CHIP program integration supports stable participation',
        'Lower volatility reflects essential pediatric service nature'
      ],
      billingImpact: {
        directBilling: 96,
        incidentToBilling: 4,
        estimatedUndercount: 1
      },
      practicePatterns: {
        avgPatients: 95,
        ruralPercentage: 9,
        chcAffiliation: 4,
        preventiveCare: 88
      }
    }
  };

  const currentData = specialtyData[selectedSpecialty];

  const participationData = {
    labels: ['Stable', 'Major Increase', 'Major Decrease'],
    datasets: [{
      data: [currentData.stable, currentData.increase, currentData.decrease],
      backgroundColor: ['#f59e0b', '#10b981', '#ef4444'],
      borderWidth: 0,
      hoverOffset: 10
    }]
  };

  const billingBreakdownData = {
    labels: ['Direct Billing', 'Incident To Billing'],
    datasets: [{
      data: [currentData.billingImpact.directBilling, currentData.billingImpact.incidentToBilling],
      backgroundColor: ['#3b82f6', '#f59e0b'],
      borderWidth: 0,
    }]
  };

  const compareAllSpecialties = {
    labels: ['Nurse Practitioners', 'Physician Associates', 'Family Medicine', 'Internal Medicine', 'OB/GYN', 'Pediatrics'],
    datasets: [
